The boys are back as Christoph invites Keiran to fly to Paris and flip women like crepes! Once exposed to the beautiful women of France, Keiran vows to transform The City of Light into The City of Delight, and Christoph obliges by presenting him with a hotel suite containing none other than the lovely Tiffany Doll.
